window.bookSummaryJSON = "<p>Lox has made friends and gotten a good start to his new life in WoM.</p> <p>After spending some time hunting down the remnants of the pirate fleet, Lox is guided by Vannessa down to the Kingdom of Sails. There he gets swept up a quest that will shake this kingdom to its core.</p> <p>Sailing his ship, the <i>Audacious</i>, Lox embraces a life of the high seas and explores this strange realm nestled in one of the most beautiful and enormous archipelagoes in any world.</p>"; 
